INSERT INTO `artists` VALUES (61,'OLGA GAIDASH','OLGA GAIDASH born 1991 in Mykolaiv. In 2011 she graduated from Mykolaiv Art College, where she studied decorative and applied arts and, in 2016, from the National Academy of Fine Arts and Architecture, department of stage design and media art. In 2017–2018 she was studying at the Universität der Künste Berlin, with the support of the DAAD scholarship programme. She is a member of «Montazh» collective. Lives and works in Kyiv.','2020-02-01 14:43:29.418392','2020-04-22 19:50:53.622412','OLGA','GAIDASH',0),(71,'KSENIA HNYLYTSKA','KSENIA HNYLYTSKA was born 1984 in Kyiv. Graduated in 2009 from the National Academy of Fine Arts and Architecture in Kyiv. Since 2002, Hnylytska is a co-founder of the Ukrainian artist group R.E.P. and participates in their numerous exhibitions, projects and activities. Her works have been shown at numerous venues, such as the National Art Museum of Ukraine and Visual Culture Research Center in Kyiv. She also works as a curator, being a member of Hudrada multidisciplinary collective. She was a resident at LIA—Leipzig International Art Program in 2008. In her practice, Ksenia usually addresses social topics and chooses painting as her main media. She lives and works in Kyiv.','2020-02-01 14:46:29.501519','2020-04-22 19:50:53.627971','KSENIA','HNYLYTSKA',0),(81,'LUCY IVANOVA','LUCY IVANOVA was born 1989 in Dnipro. In 2009 she graduated from the Art and Theatre College in Dnipro where she studied at the studio of H.Cherneta. In 2015 she graduated from the National Academy of Fine Arts and Architecture. She is a member of «Montazh» collective.\r\nLives and works in Kyiv.','2020-02-01 14:54:26.805283','2020-04-22 19:50:53.630712','LUCY','IVANOVA',0),(91,'SASHA KURMAZ','Sasha Kurmaz was born 1986 in Kyiv, Ukraine, where he lives and works today. The multidisciplinary artist works with photography and public intervention, video and performative practices. In most of his work he plays a game of de-powering power structures, using both humoristic and conceptual interventions. He participated in many international group exhibitions and festivals, including exhibitions at the Zamek Ujazdowski Art Centre, ZKM Museum of Contemporary Art Karlsruhe, Vienna Künstlerhaus, Architekturzentrum Wien, 19th Biel/Bienne Festival of Photography, Saatchi Gallery and PinchukArtCentre 2016. His work has been published in a wide range of international magazines, including FOAM, Krytyka Polityczna, YET, Vice, Liberation, Bloomberg Businessweek, Rolling Stones and Süddeutsche Zeitung.','2020-02-01 14:55:33.928482','2020-04-22 19:50:53.633075','SASHA','KURMAZ',0),(101,'ANNA SCHERBYNA','Graduated from Odessa’s Art School and National Academy of Fine Arts and Architecture. The co-founder and participant of Concrete Dates Collective (2015-2017).\r\nLives and works in Kyiv.','2020-02-01 14:57:42.030533','2020-04-22 19:50:53.635585','ANNA','SCHERBYNA',0),(111,'SERHIY SABAKAR','Serhiy Sabakar, an artist, senior lecturer at NAOMA, was born\r\n1982 in Sumy. Graduated from Sumy Higher School of Arts and Culture D.S. IN\r\n2007–2009 completed NAOM internship. In 2009 he took part in LIA international residency programs - Leipzig International Art Program, Leipzig and Villa Waldberta, Munich, Germany. He has participated in exhibitions and festivals, including\r\nRencontres Internationales Paris / Berlin at the Auditorium du Louvre, Paris (2019); Haus der Kulturen der Welt, Berlin (2019); Creating Ruin, Abbey Gateway, Reading, United Kingdom (2018), Artee Zug, Altstadthalle, Zug, Switzerland (2011), Bosch Parade, Hertogenbosch, Holland (2010), Rundgang Spinnerei, Leipzig, Germany (2009), All-Ukrainian the Triennial of Graphics, Kiev (2009). Personal exhibitions: \"Outside\", Closer Art Center, Kyiv (2016); “Spectators in the forest. Artist and Manipulation ”, Weltraum, Munich, Germany (2009).\r\nLives and works in Kyiv.','2020-02-01 14:59:30.544180','2020-04-22 19:50:53.640355','SERHIY','SABAKAR',0),(131,'OLEKSANDRA KADZEVYCH','Oleksandra Kadzevych born in 1992, Odesa, Ukraine. In 2011 she graduated from the Painting Department of the Grekov Art College in Odesa and in 2018 she completed Contemporary Art programme at Kyiv Academy of Media Arts. She is the co-founder of Noch informal art space. In September-October 2019 Oleksandra participated in residencies at Edinburgh Sculpture\r\nWorkshop and Pier Arts Centre as a part of SWAP UK/Ukraine Programme of British Council. She is shortlisted for PinchukArtCentre Prize 2020. Oleksandra lives and works in Odessa,\r\nUkraine.','2020-02-01 15:03:08.666467','2020-04-22 19:50:53.643806','OLEKSANDRA','KADZEVYCH',0),(133,'ANNA ZVYAGINTSEVA','Anna Zvyagintseva was born 1986, Dnipro. She lives and works in Kyiv. Anna studied at the National Academy of Fine Arts and Architecture in Kyiv, department of painting (graduated in 2010). Since 2010 she is a member of the curatorial group «Hudrada». In 2018 she was shortlisted for the international FutureGenerationArtPrize and participated in the nominees’ exhibition in Kyiv in Venice. She was awarded the main PinchukArtPrize in 2017, and in 2015 have been awarded Special Prize as well as received Public Choice Prize. In 2015 she participated in Pavilion of Ukraine “Hope!”, at the 56th International Art Exhibition in Venice. She also took part in two Kyiv Biennials: The School of Kyiv (2015) and Kyiv International (2017).','2020-03-02 12:58:15.762936','2020-04-22 19:50:53.648902','ANNA','ZVYAGINTSEVA',0),(134,'PETRO RYASKA','Petro Ryaska was born 1975 in Bilky village in Transcarpathia. In 2004–2009 studied at Transcarpathian Art Institute. Since 2010 he is a member of the National Union of Artists. Founder and curator of artist residency programmes, «Sorry no rooms available» (Uzhhorod) and «Cows Plying» (Verkhnye Bukivtsiovo village in Transcarpathia). \r\nLives and works in Uzhhorod and Bilky.','2020-03-02 12:59:29.989213','2020-04-22 19:50:53.651568','PETRO','RYASKA',0),(135,'VIACHESLAV POLIAKOV','Viacheslav Poliakov was born in 1986 in Kherson. Obtained an MA degree from Kherson State University, mixing traditional ink drawings with 3d graphics. As part of community grouped around \"Totem\" cultural center. In 2012 moved to Lviv and focused on photography. In Lviv Viacheslav met Elena Subach and began to work as a duo exploring small cities of western Ukraine. He is finalist of Foam Talents 2017, Circulations 2018, Krakow Photomonth Showoff 2017, Photofestival Lodz Grand Prix 2017, Prix Levallois 2017, Vienna Photobook Festival Award 2017. Poliakov\'s works were published in British Journal of Photography, GUP magaizne, Lensculture.','2020-03-02 14:09:13.024378','2020-04-22 19:50:53.654539','VIACHESLAV','POLIAKOV',0),(136,'OLENA SUBACH','Olena Subach was born in Ukraine in 1980. She obtained her master’s degree in Economics at the Volyn State University and started working as a textile designer. In 2011, she developed her approach of photography and joined the artistic community 5×5 / Dzyga. In 2016, she was awarded the special prize at the New East Photo Prize. She showed her work in collective exhibitions in Georgia, Germany, France, and Ukraine. Live in Lviv \r\n\r\n','2020-03-02 14:09:51.836695','2020-04-22 19:50:53.657551','OLENA','SUBACH',0),(137,'SERHIY MISHAKIN','','2020-03-02 14:10:43.747893','2020-04-22 19:50:53.659809','SERHIY','MISHAKIN',0),(138,'YEVGEN NIKIFOROV','Yevgen Nikiforov was born in Vasylkiv, Ukraine, 1986. Graduated from Geographic Photography College (Tel Aviv) and Victor Maruschenko\'s School of Photography (Kyiv). Started professional photography practice in 2005. Since 2013 has been working on independent documentary projects. One of the major topics he has been working on for almost 4 years is the Soviet cultural heritage and architecture left in towns all around Ukraine and the controversial attitude towards it today. Author of the book Decommunized: Ukrainian Soviet Mosaics (2017, Osnovy–DOM Publishers). Participant of Festival of Young Ukrainian Artists (Mystetskyi Arsenal, 2017), Biennial of Young Ukrainian Art (Kharkiv, 2019) and SWAP UK/Ukraine residency programme organised by British Council Ukraine.','2020-03-02 14:11:23.366172','2020-04-22 19:50:53.661899','YEVGEN','NIKIFOROV',0),(139,'STUDIO TROYANDA','Olga Gaidash is an artist, born 1991 in Mykolaiv. In 2011 she graduated from Mykolaiv Art\r\nCollege, where she studied decorative and applied arts and, in 2016, from the National\r\nAcademy of Fine Arts and Architecture, department of stage design and media art. In\r\n2017–2018 she was studying at the Universität der Künste Berlin, with the support of the DAAD\r\nscholarship programme. She is a member of «Montazh» collective. Lives and works in Kyiv.\r\n                                               \r\nAnna Riabova is and architect and interior designer, born 1992 in Kyiv. In 2014 she graduated\r\nfrom the National Academy of Fine Arts and Architecture. In 2014-2018 worked as an architect\r\nin 2b group. Since 2018 has an independent architectural practice. In 2017 was awarded with\r\nIIDA global excellence awards.','2020-03-02 14:12:21.731667','2020-04-22 19:50:53.664477','STUDIO','TROYANDA',0),(140,'BOHDAN BUNCHAK','Bohdan Bunchak, born in 1995 in the town of Stryi, lived in Bolekhiv for several years, and is currently based in Kyiv. He studied at the Department of Fine Arts at the Borys Hrynchenko\r\nUniversity of Arts. In 2018 he graduated from Kyiv Academy of Media Arts. His artistic and research practices are focused on questions dealing with relationship between Orthodoxy and\r\ncontemporary art.','2020-03-02 14:12:59.279994','2020-04-22 19:50:53.667504','BOHDAN','BUNCHAK',0),(141,'PAVLO MAKOV ','Pavlo Makov was born in 1958 in Leningrad, USSR. He studied at Saint\nPetersburg Academy of Arts, Crimean Art College after M. Samokish in\nSimferopol, Crimea and Kharkiv Art and Industrial Institute, at the faculty\nof graphic arts. He is a member of the Artists Union of Ukraine (since 198),\na member of the Royal Society of Painters-Printmakers, UK (since 1994),\nan associate member of the Academy of Arts of Ukraine (since 2006). In 2009\nhe was awarded with the Silver Medal of the Academy of Arts of Ukraine and\nin 2018 he got the State Shevchenko Prize. The artist lives and works in\nKharkiv, Ukraine.','2020-03-26 14:28:46.375675','2020-04-22 19:50:53.669916','PAVLO','MAKOV',0),(142,'ALINA KOPYTSA ','Born 1983 in Poliske in the Kyiv region, Ukraine. \nIN 2000-2006 studied at National Technical University Ukraine “Kyiv Polytechnic Institute”, department of graphic arts; from 2017 studies “Kunst und Medien” at Zürcher Hochschule der Künste. Live and works in Zurich\n','2020-04-09 13:57:06.909334','2020-04-22 19:50:53.673766','ALINA','KOPYTSA',0),(143,'DRAWINGS AND SKETCHES','A selection of drawings, sketches and graphics by Ukrainian artists represented by The Naked Room. Artpiece on paper is a great start for a new collection of your own. After all, every big art project begins with an outline. These works are available for online purchase&delivery as well as for a preview in the gallery showroom on appointment. ','2020-04-11 12:02:21.406846','2020-04-22 19:48:23.563315',NULL,NULL,1),(144,'POSTERS','Highlights of The Naked Room exhibition program printed on a high-quality paper.\nAvailable for online purchase&delivery. ','2020-04-11 12:02:40.037843','2020-04-22 19:47:52.630423',NULL,NULL,1);
